tps:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F_(%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%BE)\" class=\"mw-redirect\" title=\"\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u0420\u043e\u0441\u0441\u0438\u044f (\u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e)\">\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u0420\u043e\u0441\u0441\u0438\u0435\u0439<\/a>.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> \u043d\u0430 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0441\u043a\u0438\u0445 \u0432\u044b\u0431\u043e\u0440\u0430\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D0%B5%D1%80%D0%B2%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D0%B8\" title=\"\u041a\u043e\u043d\u0441\u0435\u0440\u0432\u0430\u0442\u0438\u0432\u043d\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438\">\u043a\u043e\u043d\u0441\u0435\u0440\u0432\u0430\u0442\u043e\u0440\u044b<\/a> \u043f\u043e\u043b\u0443\u0447\u0430\u044e\u0442 345 \u043c\u0435\u0441\u0442, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%B9%D0%B1%D0%BE%D1%80%D0%B8%D1%81%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_(%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F)\" title=\"\u041b\u0435\u0439\u0431\u043e\u0440\u0438\u0441\u0442\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f (\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f)\">\u043b\u0435\u0439\u0431\u043e\u0440\u0438\u0441\u0442\u044b<\/a>&#160;\u2014 142, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B1%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_(%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F)\" class=\"mw-redirect\" title=\"\u041b\u0438\u0431\u0435\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f (\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f)\">\u043b\u0438\u0431\u0435\u0440\u0430\u043b\u044b<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BB%D0%BE%D0%B9%D0%B4_%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B6,_%D0%94%D1%8D%D0%B2%D0%B8%D0%B4\" title=\"\u041b\u043b\u043e\u0439\u0434 \u0414\u0436\u043e\u0440\u0434\u0436, \u0414\u044d\u0432\u0438\u0434\">\u041b\u043b\u043e\u0439\u0434\u0430 \u0414\u0436\u043e\u0440\u0434\u0436\u0430<\/a>&#160;\u2014 62, \u043b\u0438\u0431\u0435\u0440\u0430\u043b\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%81%D0%BA%D0%B2%D0%B8%D1%82,_%D0%93%D0%B5%D1%80%D0%B1%D0%B5%D1%80%D1%82_%D0%93%D0%B5%D0%BD%D1%80%D0%B8\" title=\"\u0410\u0441\u043a\u0432\u0438\u0442, \u0413\u0435\u0440\u0431\u0435\u0440\u0442 \u0413\u0435\u043d\u0440\u0438\">\u0410\u0441\u043a\u0432\u0438\u0442\u0430<\/a>&#160;\u2014 54.<\/li><li>\u0425\u0430\u043b\u0438\u0444 \u0438 \u0431\u044b\u0432\u0448\u0438\u0439 \u0441\u0443\u043b\u0442\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D1%86%D0%B8%D1%8F\" title=\"\u0422\u0443\u0440\u0446\u0438\u044f\">\u0422\u0443\u0440\u0446\u0438\u0438<\/a> \u041c\u0443\u0445\u0430\u043c\u043c\u0435\u0434 VI \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043d\u0438\u0437\u043b\u043e\u0436\u0435\u043d\u043d\u044b\u043c \u0438 \u0443\u043a\u0440\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043d\u0430 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u043c \u0432\u043e\u0435\u043d\u043d\u043e\u043c \u043a\u043e\u0440\u0430\u0431\u043b\u0435. \u0415\u0433\u043e \u043d\u0430\u0441\u043b\u0435\u0434\u043d\u0438\u043a, \u043f\u0440\u0438\u043d\u0446 \u0410\u0431\u0434 \u0443\u043b\u044c-\u041c\u0435\u0434\u0436\u0438\u0434, \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0435\u0442 \u0442\u0438\u0442\u0443\u043b \u0445\u0430\u043b\u0438\u0444\u0430, \u043e\u0442\u043a\u0430\u0437\u0430\u0432\u0448\u0438\u0441\u044c \u043e\u0442 \u0442\u0438\u0442\u0443\u043b\u0430 \u0441\u0443\u043b\u0442\u0430\u043d\u0430.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1927_%D0%B3%D0%BE%D0%B4\" title=\"1927 \u0433\u043e\u0434\">1927<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D0%B3%D1%80%D0%B0%D0%B4\" class=\"mw-redirect\" title=\"\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\">\u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0435<\/a> \u0432\u044b\u0445\u043e\u0434\u044f\u0442 \u0432 \u0441\u0432\u0435\u0442 \u043f\u0435\u0440\u0432\u044b\u0435 \u043d\u043e\u043c\u0435\u0440\u0430 \u043f\u0435\u0440\u0432\u044b\u0445 \u0437\u0430\u0432\u043e\u0434\u0441\u043a\u0438\u0445 \u043c\u043d\u043e\u0433\u043e\u0442\u0438\u0440\u0430\u0436\u0435\u043a&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%BE%D1%81%D0%B8%D0%BB%D0%B0_(%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4)\" title=\"\u042d\u043b\u0435\u043a\u0442\u0440\u043e\u0441\u0438\u043b\u0430 (\u0437\u0430\u0432\u043e\u0434)\">\u00ab\u042d\u043b\u0435\u043a\u0442\u0440\u043e\u0441\u0438\u043b\u0430\u00bb<\/a> \u0438 \u00ab\u041a\u0440\u0430\u0441\u043d\u0430\u044f \u0437\u0430\u0440\u044f\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1929_%D0%B3%D0%BE%D0%B4\" title=\"1929 \u0433\u043e\u0434\">1929<\/a>&#160;\u2014 \u041f\u043b\u0435\u043d\u0443\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%9A_%D0%92%D0%9A%D0%9F(%D0%B1)\" class=\"mw-redirect\" title=\"\u0426\u041a \u0412\u041a\u041f(\u0431)\">\u0426\u041a \u0412\u041a\u041f(\u0431)<\/a> \u0432\u044b\u0432\u043e\u0434\u0438\u0442 \u0438\u0437 \u0441\u043e\u0441\u0442\u0430\u0432\u0430 \u041f\u043e\u043b\u0438\u0442\u0431\u044e\u0440\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D1%85%D0%B0%D1%80%D0%B8%D0%BD,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0443\u0445\u0430\u0440\u0438\u043d, \u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u041d\u0438\u043a\u043e\u043b\u0430\u044f \u0411\u0443\u0445\u0430\u0440\u0438\u043d\u0430<\/a> \u043a\u0430\u043a \u00ab\u0437\u0430\u0441\u0442\u0440\u0435\u043b\u044c\u0449\u0438\u043a\u0430 \u0438 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f \u043f\u0440\u0430\u0432\u044b\u0445 \u043a\u0430\u043f\u0438\u0442\u0443\u043b\u044f\u043d\u0442\u043e\u0432\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1930_%D0%B3%D0%BE%D0%B4\" title=\"1930 \u0433\u043e\u0434\">1930<\/a>&#160;\u2014 \u041d\u0430 \u041a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u0438 \u043f\u043e \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u043c \u0432\u043e\u043f\u0440\u043e\u0441\u0430\u043c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B5%D0%BD%D0%B5%D0%B2%D0%B0\" title=\"\u0416\u0435\u043d\u0435\u0432\u0430\">\u0416\u0435\u043d\u0435\u0432\u0435<\/a> (\u043f\u043e 28 \u043d\u043e\u044f\u0431\u0440\u044f) \u043d\u0430 \u043f\u043e\u0432\u0435\u0441\u0442\u043a\u0435 \u0434\u043d\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0%D1%8F_%D0%B4%D0%B5%D0%BF%D1%80%D0%B5%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u0430\u044f \u0434\u0435\u043f\u0440\u0435\u0441\u0441\u0438\u044f\">\u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0434\u0435\u043f\u0440\u0435\u0441\u0441\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1932_%D0%B3%D0%BE%D0%B4\" title=\"1932 \u0433\u043e\u0434\">1932<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BF%D0%B5%D0%BD,_%D0%A4%D1%80%D0%B0%D0%BD%D1%86_%D1%84%D0%BE%D0%BD\" title=\"\u041f\u0430\u043f\u0435\u043d, \u0424\u0440\u0430\u043d\u0446 \u0444\u043e\u043d\">\u0424\u0440\u0430\u043d\u0446 \u0444\u043e\u043d \u041f\u0430\u043f\u0435\u043d<\/a> \u0443\u0445\u043e\u0434\u0438\u0442 \u0432 \u043e\u0442\u0441\u0442\u0430\u0432\u043a\u0443 \u0441 \u043f\u043e\u0441\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D1%86%D0%BB%D0%B5%D1%80\" title=\"\u041a\u0430\u043d\u0446\u043b\u0435\u0440\">\u043a\u0430\u043d\u0446\u043b\u0435\u0440\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a>, \u0447\u0442\u043e\u0431\u044b \u0434\u0430\u0442\u044c \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u044c \u0441\u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u0442\u044c \u043d\u043e\u0432\u0443\u044e \u043a\u043e\u0430\u043b\u0438\u0446\u0438\u044e \u043d\u0430 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0445 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0441\u043a\u0438\u0445 \u0432\u044b\u0431\u043e\u0440\u0430\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933_%D0%B3%D0%BE%D0%B4\" title=\"1933 \u0433\u043e\u0434\">1933<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u0437\u0430\u044f\u0432\u043b\u044f\u044e\u0442 \u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B6%D0%B4%D1%83%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%BE-%D0%BF%D1%80%D0%B0%D0%B2%D0%BE%D0%B2%D0%BE%D0%B5_%D0%BF%D1%80%D0%B8%D0%B7%D0%BD%D0%B0%D0%BD%D0%B8%D0%B5\" title=\"\u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u043e-\u043f\u0440\u0430\u0432\u043e\u0432\u043e\u0435 \u043f\u0440\u0438\u0437\u043d\u0430\u043d\u0438\u0435\">\u043f\u0440\u0438\u0437\u043d\u0430\u043d\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u0438 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0430\u0432\u043b\u0438\u0432\u0430\u044e\u0442 \u0441 \u043d\u0438\u043c \u0442\u043e\u0440\u0433\u043e\u0432\u044b\u0435 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f.<\/li><li>\u0421\u043e\u0437\u0434\u0430\u043d\u0438\u0435 \u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u043d\u0430\u0443\u0447\u043d\u043e-\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442\u0430 \u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b (\u0412\u041d\u0418\u0418\u0424\u041a).<\/li><li>\u041e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D1%80%D1%8C%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D1%80%D0%B0%D0%BC%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D0%B5%D0%B0%D1%82%D1%80_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%9F%D1%83%D1%88%D0%BA%D0%B8%D0%BD%D0%B0\" class=\"mw-redirect\" title=\"\u0425\u0430\u0440\u044c\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u0434\u0440\u0430\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0442\u0435\u0430\u0442\u0440 \u0438\u043c\u0435\u043d\u0438 \u041f\u0443\u0448\u043a\u0438\u043d\u0430\">\u0425\u0430\u0440\u044c\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0433\u043e \u0430\u043a\u0430\u0434\u0435\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e \u0434\u0440\u0430\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0442\u0435\u0430\u0442\u0440\u0430 \u0438\u043c. \u0410.&#160;\u0421.&#160;\u041f\u0443\u0448\u043a\u0438\u043d\u0430<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1935_%D0%B3%D0%BE%D0%B4\" title=\"1935 \u0433\u043e\u0434\">1935<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u0437\u0430\u0432\u0435\u0440\u0448\u0430\u0435\u0442 \u0440\u0430\u0431\u043e\u0442\u0443 \u041f\u0435\u0440\u0432\u043e\u0435 \u0412\u0441\u0435\u0441\u043e\u044e\u0437\u043d\u043e\u0435 \u0441\u043e\u0432\u0435\u0449\u0430\u043d\u0438\u0435 \u0440\u0430\u0431\u043e\u0447\u0438\u0445 \u0438 \u0440\u0430\u0431\u043e\u0442\u043d\u0438\u0446-<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D1%85%D0%B0%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B5_%D0%B4%D0%B2%D0%B8%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u0421\u0442\u0430\u0445\u0430\u043d\u043e\u0432\u0441\u043a\u043e\u0435 \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u0435\">\u0441\u0442\u0430\u0445\u0430\u043d\u043e\u0432\u0446\u0435\u0432<\/a>, \u043e\u0442\u043a\u0440\u044b\u0432\u0448\u0435\u0435\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/14_%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8F\" title=\"14 \u043d\u043e\u044f\u0431\u0440\u044f\">14 \u043d\u043e\u044f\u0431\u0440\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1937_%D0%B3%D0%BE%D0%B4\" title=\"1937 \u0433\u043e\u0434\">1937<\/a>&#160;\u2014 \u0427\u043b\u0435\u043d \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%83%D0%B4,_%D0%AD%D0%B4%D1%83%D0%B0%D1%80%D0%B4\" class=\"mw-redirect\" title=\"\u0412\u0443\u0434, \u042d\u0434\u0443\u0430\u0440\u0434\">\u043b\u043e\u0440\u0434 \u0413\u0430\u043b\u0438\u0444\u0430\u043a\u0441<\/a> \u0432\u0441\u0442\u0440\u0435\u0447\u0430\u0435\u0442\u0441\u044f \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D1%82%D0%BB%D0%B5%D1%80,_%D0%90%D0%B4%D0%BE%D0%BB%D1%8C%D1%84\" title=\"\u0413\u0438\u0442\u043b\u0435\u0440, \u0410\u0434\u043e\u043b\u044c\u0444\">\u0413\u0438\u0442\u043b\u0435\u0440\u043e\u043c<\/a>, \u043f\u044b\u0442\u0430\u044f\u0441\u044c \u0440\u0435\u0448\u0438\u0442\u044c \u0441\u0443\u0434\u0435\u0442\u0441\u043a\u0438\u0439 \u0432\u043e\u043f\u0440\u043e\u0441 \u043c\u0438\u0440\u043d\u044b\u043c \u043f\u0443\u0442\u0451\u043c (\u043f\u0435\u0440\u0435\u0433\u043e\u0432\u043e\u0440\u044b \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u044e\u0442\u0441\u044f \u0434\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/21_%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8F\" title=\"21 \u043d\u043e\u044f\u0431\u0440\u044f\">21 \u043d\u043e\u044f\u0431\u0440\u044f<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1938_%D0%B3%D0%BE%D0%B4\" title=\"1938 \u0433\u043e\u0434\">1938<\/a>&#160;\u2014 \u041f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u0421\u041d\u041a \u0421\u0421\u0421\u0420 \u0438 \u0426\u041a \u0412\u041a\u041f(\u0431) \u00ab\u041e\u0431 \u0430\u0440\u0435\u0441\u0442\u0430\u0445, \u043f\u0440\u043e\u043a\u0443\u0440\u043e\u0440\u0441\u043a\u043e\u043c \u043d\u0430\u0434\u0437\u043e\u0440\u0435 \u0438 \u0432\u0435\u0434\u0435\u043d\u0438\u0438 \u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u044f\u00bb<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a>&#160;\u2014 \u043f\u0440\u0438\u043a\u0430\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D0%B2%D0%BA%D0%B0_%D0%92%D0%B5%D1%80%D1%85%D0%BE%D0%B2%D0%BD%D0%BE%D0%B3%D0%BE_%D0%93%D0%BB%D0%B0%D0%B2%D0%BD%D0%BE%D0%BA%D0%BE%D0%BC%D0%B0%D0%BD%D0%B4%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0421\u0442\u0430\u0432\u043a\u0430 \u0412\u0435\u0440\u0445\u043e\u0432\u043d\u043e\u0433\u043e \u0413\u043b\u0430\u0432\u043d\u043e\u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u044f\">\u0421\u0442\u0430\u0432\u043a\u0438<\/a> \u2116&#160;0428 \u00ab\u2026\u0420\u0430\u0437\u0440\u0443\u0448\u0430\u0442\u044c \u0438 \u0441\u0436\u0438\u0433\u0430\u0442\u044c \u0434\u043e\u0442\u043b\u0430 \u0432\u0441\u0435 \u043d\u0430\u0441\u0435\u043b\u0451\u043d\u043d\u044b\u0435 \u043f\u0443\u043d\u043a\u0442\u044b \u0432 \u0442\u044b\u043b\u0443 \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a\u2026\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1942_%D0%B3%D0%BE%D0%B4\" title=\"1942 \u0433\u043e\u0434\">1942<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%9B%D0%B8-2_%D0%B2_%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%BE%D1%8F%D1%80%D1%81%D0%BA%D0%B5_(1942)\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u041b\u0438-2 \u0432 \u041a\u0440\u0430\u0441\u043d\u043e\u044f\u0440\u0441\u043a\u0435 (1942)\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u041b\u0438-2 \u0432 \u041a\u0440\u0430\u0441\u043d\u043e\u044f\u0440\u0441\u043a\u0435<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 30 \u0447\u0435\u043b\u043e\u0432\u0435\u043a&#160;\u2014 \u043b\u0451\u0442\u043d\u044b\u0435 \u044d\u043a\u0438\u043f\u0430\u0436\u0438, \u043f\u0435\u0440\u0435\u0433\u043e\u043d\u044f\u044e\u0449\u0438\u0435 \u043f\u043e \u0442\u0440\u0430\u0441\u0441\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%81%D0%B8%D0%B1\" title=\"\u0410\u043b\u0441\u0438\u0431\">\u0410\u043b\u0441\u0438\u0431<\/a> (\u0410\u043b\u044f\u0441\u043a\u0430\u2014\u