434\">1953<\/a><ul><li>\u0411\u0435\u0441\u043f\u0430\u0440\u0442\u0438\u0439\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BD%D0%BB%D1%8F%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u044f\">\u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u0438<\/a> \u0444\u043e\u0440\u043c\u0438\u0440\u0443\u0435\u0442 \u0443\u043f\u0440\u0430\u0432\u043b\u044f\u044e\u0449\u0438\u0439 \u0411\u0430\u043d\u043a\u043e\u043c \u0424\u0438\u043d\u043b\u044f\u043d\u0434\u0438\u0438.<\/li><li>\u041e\u0442\u043a\u0440\u044b\u0442\u0438\u0435 \u0434\u043e\u0441\u0442\u0443\u043f\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B2%D0%B7%D0%BE%D0%BB%D0%B5%D0%B9_%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D0%B0\" title=\"\u041c\u0430\u0432\u0437\u043e\u043b\u0435\u0439 \u041b\u0435\u043d\u0438\u043d\u0430\">\u043c\u0430\u0432\u0437\u043e\u043b\u0435\u0439 \u041b\u0435\u043d\u0438\u043d\u0430<\/a>&#160;\u2014 \u0421\u0442\u0430\u043b\u0438\u043d\u0430.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1955_%D0%B3%D0%BE%D0%B4\" title=\"1955 \u0433\u043e\u0434\">1955<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D1%8D%D1%82%D0%BB\" title=\"\u0421\u0438\u044d\u0442\u043b\">\u0421\u0438\u044d\u0442\u043b<\/a>, \u0448\u0442\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%88%D0%B8%D0%BD%D0%B3%D1%82%D0%BE%D0%BD_(%D1%88%D1%82%D0%B0%D1%82)\" title=\"\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d (\u0448\u0442\u0430\u0442)\">\u0412\u0430\u0448\u0438\u043d\u0433\u0442\u043e\u043d<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>. \u0421\u0430\u043c\u043e\u043b\u0451\u0442 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Douglas_C-54_Skymaster\" title=\"Douglas C-54 Skymaster\">Douglas C-54<\/a>\u00bb \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 \u00abKrekorian\u00bb, R.R. \u0440\u0430\u0437\u0431\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u043d\u0430 \u0432\u0437\u043b\u0451\u0442\u0435. \u0412\u0441\u0435 28 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043f\u043e\u0433\u0438\u0431\u0430\u044e\u0442. \u041e\u0448\u0438\u0431\u043a\u0430 \u043f\u0440\u0435\u0434\u043f\u043e\u043b\u0451\u0442\u043d\u043e\u0439 \u043f\u043e\u0434\u0433\u043e\u0442\u043e\u0432\u043a\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1956_%D0%B3%D0%BE%D0%B4\" title=\"1956 \u0433\u043e\u0434\">1956<\/a><ul><li>\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u043e\u043d\u043d\u0430\u044f \u0430\u0441\u0441\u0430\u043c\u0431\u043b\u0435\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B6%D0%B0%D0%BC%D0%BC%D1%83_%D0%B8_%D0%9A%D0%B0%D1%88%D0%BC%D0%B8%D1%80\" title=\"\u0414\u0436\u0430\u043c\u043c\u0443 \u0438 \u041a\u0430\u0448\u043c\u0438\u0440\">\u0414\u0436\u0430\u043c\u043c\u0443 \u0438 \u041a\u0430\u0448\u043c\u0438\u0440\u0435<\/a> \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0435\u0442 \u043d\u043e\u0432\u0443\u044e \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044e (\u0434\u043e\u043b\u0436\u043d\u0430 \u0432\u0441\u0442\u0443\u043f\u0438\u0442\u044c \u0432 \u0441\u0438\u043b\u0443 26 \u044f\u043d\u0432\u0430\u0440\u044f 1957) \u0438 \u043f\u043e\u0434\u0442\u0432\u0435\u0440\u0436\u0434\u0430\u0435\u0442 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u043e \u043f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0438 \u043a \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u043d\u0434\u0438\u044f\">\u0418\u043d\u0434\u0438\u044f<\/a>.<\/li><li>\u0413\u043e\u0440\u044b \u042d\u043b\u044c \u0420\u0443\u0441\u0438\u043e, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1%D0%B8%D1%8F\" title=\"\u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f\">\u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f<\/a>. \u0420\u0430\u0437\u0431\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u0441\u0430\u043c\u043e\u043b\u0451\u0442 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Douglas_DC-3\" title=\"Douglas DC-3\">Douglas DC-3<\/a>\u00bb \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 \u00abEmpresa Aviacion del Pacifico\u00bb. \u0412\u0441\u0435 36 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043f\u043e\u0433\u0438\u0431\u0430\u044e\u0442. \u041f\u0438\u043b\u043e\u0442 \u043d\u0430\u0440\u0443\u0448\u0438\u043b \u0434\u0438\u0441\u0446\u0438\u043f\u043b\u0438\u043d\u0443 \u0432 \u043a\u0430\u0431\u0438\u043d\u0435 \u044d\u043a\u0438\u043f\u0430\u0436\u0430.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1958_%D0%B3%D0%BE%D0%B4\" title=\"1958 \u0433\u043e\u0434\">1958<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D0%B4%D0%B0%D0%BD\" title=\"\u0421\u0443\u0434\u0430\u043d\">\u0421\u0443\u0434\u0430\u043d\u0435<\/a> \u043a \u0432\u043b\u0430\u0441\u0442\u0438 \u043f\u0440\u0438\u0445\u043e\u0434\u0438\u0442 \u0430\u0440\u043c\u0438\u044f, \u0438 \u0433\u0435\u043d\u0435\u0440\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B1%D0%B1%D1%83%D0%B4,_%D0%98%D0%B1%D1%80%D0%B0%D1%85%D0%B8%D0%BC\" title=\"\u0410\u0431\u0431\u0443\u0434, \u0418\u0431\u0440\u0430\u0445\u0438\u043c\">\u0418\u0431\u0440\u0430\u0433\u0438\u043c \u0410\u0431\u0431\u0443\u0434<\/a> \u0437\u0430\u043d\u0438\u043c\u0430\u0435\u0442 \u043f\u043e\u0441\u0442\u044b \u0433\u043b\u0430\u0432\u044b \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430, \u043f\u0440\u0435\u043c\u044c\u0435\u0440-\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430 \u0438 \u0433\u043b\u0430\u0432\u043d\u043e\u043a\u043e\u043c\u0430\u043d\u043