\u043d\u0430\u0447\u0438\u043d\u0430\u0435\u0442 \u043f\u0440\u043e\u0438\u0437\u0432\u043e\u0434\u0441\u0442\u0432\u043e \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%BC%D0%B0%D0%B7\" title=\"\u0410\u043b\u043c\u0430\u0437\">\u0430\u043b\u043c\u0430\u0437\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1961_%D0%B3%D0%BE%D0%B4\" title=\"1961 \u0433\u043e\u0434\">1961<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%A1%D0%A8%D0%90\" title=\"\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0421\u0428\u0410\">\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0421\u0428\u0410<\/a> \u043e\u0442\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f \u043f\u043e\u0434\u0447\u0438\u043d\u044f\u0442\u044c\u0441\u044f \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u044e \u0412\u0435\u0440\u0445\u043e\u0432\u043d\u043e\u0433\u043e \u0441\u0443\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>, \u0432 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438 \u0441 \u043a\u043e\u0442\u043e\u0440\u044b\u043c \u043e\u043d\u0430 \u0434\u043e\u043b\u0436\u043d\u0430 \u0437\u0430\u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u043a\u0430\u043a \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0431\u043e\u043b\u044c\u0448\u0438\u043d\u0441\u0442\u0432\u043e \u0447\u043b\u0435\u043d\u043e\u0432 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u0446\u0430\u043c\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1962_%D0%B3%D0%BE%D0%B4\" title=\"1962 \u0433\u043e\u0434\">1962<\/a>&#160;\u2014 \u0412\u044b\u0445\u043e\u0434\u0438\u0442 \u043e\u0447\u0435\u0440\u0435\u0434\u043d\u043e\u0439 \u043d\u043e\u043c\u0435\u0440 \u0436\u0443\u0440\u043d\u0430\u043b\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D1%8B%D0%B9_%D0%BC%D0%B8%D1%80_(%D0%B6%D1%83%D1%80%D0%BD%D0%B0%D0%BB)\" class=\"mw-redirect\" title=\"\u041d\u043e\u0432\u044b\u0439 \u043c\u0438\u0440 (\u0436\u0443\u0440\u043d\u0430\u043b)\">\u041d\u043e\u0432\u044b\u0439 \u043c\u0438\u0440<\/a>\u00bb, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u0430 \u043f\u043e\u0432\u0435\u0441\u0442\u044c \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B4%D0%B8%D0%BD_%D0%B4%D0%B5%D0%BD%D1%8C_%D0%98%D0%B2%D0%B0%D0%BD%D0%B0_%D0%94%D0%B5%D0%BD%D0%B8%D1%81%D0%BE%D0%B2%D0%B8%D1%87%D0%B0\" title=\"\u041e\u0434\u0438\u043d \u0434\u0435\u043d\u044c \u0418\u0432\u0430\u043d\u0430 \u0414\u0435\u043d\u0438\u0441\u043e\u0432\u0438\u0447\u0430\">\u041e\u0434\u0438\u043d \u0434\u0435\u043d\u044c \u0418\u0432\u0430\u043d\u0430 \u0414\u0435\u043d\u0438\u0441\u043e\u0432\u0438\u0447\u0430<\/a>\u00bb. \u0421\u0442\u0440\u0430\u043d\u0430 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0443\u0437\u043d\u0430\u0451\u0442 \u0438\u043c\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%BB%D0%B6%D0%B5%D0%BD%D0%B8%D1%86%D1%8B%D0%BD,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%98%D1%81%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0421\u043e\u043b\u0436\u0435\u043d\u0438\u0446\u044b\u043d, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0418\u0441\u0430\u0435\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u0421\u043e\u043b\u0436\u0435\u043d\u0438\u0446\u044b\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1964_%D0%B3%D0%BE%D0%B4\" title=\"1964 \u0433\u043e\u0434\">1964<\/a><ul><li>\u0423\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BD%D1%8C_%D1%80%D0%B0%D0%BA%D0%B5%D1%82%D0%BD%D1%8B%D1%85_%D0%B2%D0%BE%D0%B9%D1%81%D0%BA_%D0%B8_%D0%B0%D1%80%D1%82%D0%B8%D0%BB%D0%BB%D0%B5%D1%80%D0%B8%D0%B8_(%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F)\" title=\"\u0414\u0435\u043d\u044c \u0440\u0430\u043a\u0435\u0442\u043d\u044b\u0445 \u0432\u043e\u0439\u0441\u043a \u0438 \u0430\u0440\u0442\u0438\u043b\u043b\u0435\u0440\u0438\u0438 (\u0420\u043e\u0441\u0441\u0438\u044f)\">\u0414\u0435\u043d\u044c \u0440\u0430\u043a\u0435\u0442\u043d\u044b\u0445 \u0432\u043e\u0439\u0441\u043a \u0438 \u0430\u0440\u0442\u0438\u043b\u043b\u0435\u0440\u0438\u0438<\/a> (\u0434\u043e 1964&#160;\u0433.&#160;\u2014 \u0414\u0435\u043d\u044c \u0430\u0440\u0442\u0438\u043b\u043b\u0435\u0440\u0438\u0438; \u043f\u0440\u0430\u0437\u0434\u043d\u0443\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/19_%D0%BD%D0%BE%D1%8F%D0%B1%D1%80%D1%8F\" title=\"19 \u043d\u043e\u044f\u0431\u0440\u044f\">19 \u043d\u043e\u044f\u0431\u0440\u044f<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f<\/a> \u0437\u0430\u044f\u0432\u043b\u044f\u0435\u0442 \u043e \u0441\u0432\u043e\u0451\u043c \u043d\u0430\u043c\u0435\u0440\u0435\u043d\u0438\u0438 \u0437\u0430\u043f\u0440\u0435\u0442\u0438\u0442\u044c \u044d\u043a\u0441\u043f\u043e\u0440\u0442 \u043e\u0440\u0443\u0436\u0438\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B6%D0%BD%D0%B0%D1%8F_%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u042e\u0436\u043d\u0430\u044f \u0410\u0444\u0440\u0438\u043a\u0430\">\u042e\u0436\u043d\u0443\u044e \u0410\u0444\u0440\u0438\u043a\u0443<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1966_%D0%B3%D0%BE%D0%B4\" title=\"1966 \u0433\u043e\u0434\">1966<\/a>&#160;\u2014 \u0421\u0430\u043c\u044b\u0439 \u0431\u043e\u043b\u044c\u0448\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%82%D0%B5%D0%BE%D1%80%D0%B8%D1%82\" title=\"\u041c\u0435\u0442\u0435\u043e\u0440\u0438\u0442\">\u043c\u0435\u0442\u0435\u043e\u0440\u0438\u0442\u043d\u044b\u0439<\/a> \u0434\u043e\u0436\u0434\u044c \u0437\u0430\u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u043e\u0432\u0430\u043d \u0432 \u043d\u043e\u0447\u044c \u0441 16 \u043d\u0430 17 \u043d\u043e\u044f\u0431\u0440\u044f 1966&#160;\u0433., \u043a\u043e\u0433\u0434\u0430 \u043c\u0435\u0442\u0435\u043e\u0440\u044b \u0433\u0440\u0443\u043f\u043f\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BE%D0%BD%D0%B8%D0%B4%D1%8B\" title=\"\u041b\u0435\u043e\u043d\u0438\u0434\u044b\">\u041b\u0435\u043e\u043d\u0438\u0434\u043e\u0432<\/a> (\u043f\u043e\u044f\u0432\u043b\u044f\u044e\u0442\u0441\u044f \u0440\u0435\u0433\u0443\u043b\u044f\u0440\u043d\u043e \u0447\u0435\u0440\u0435\u0437 \u043a\u0430\u0436\u0434\u044b\u0435 33,25 \u0433\u043e\u0434\u0430) \u0431\u044b\u043b\u0438 \u0432\u0438\u0434\u043d\u044b \u043d\u0430 \u043d\u0435\u0431\u0435 \u043c\u0435\u0436\u0434\u0443 \u0432\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0439 \u0447\u0430\u0441\u0442\u044c\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u0438 \u0437\u0430\u043f\u0430\u0434\u043d\u043e\u0439 \u0447\u0430\u0441\u0442\u044c\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0%D1%8F_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0410\u043c\u0435\u0440\u0438\u043a\u0430\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0410\u043c\u0435\u0440\u0438\u043a\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1967_%D0%B3%D0%BE%D0%B4\" title=\"1967 \u0433\u043e\u0434\">1967<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/The_Beatles\" title=\"The Beatles\">The Beatles<\/a> \u0437\u0430\u043a\u0430\u043d\u0447\u0438\u0432\u0430\u044e\u0442 \u0440\u0430\u0431\u043e\u0442\u0443 \u0432 \u0441\u0442\u0443\u0434\u0438\u0438 \u043d\u0430\u0434 \u0430\u043b\u044c\u0431\u043e\u043c\u043e\u043c \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Magical_Mystery_Tour_(%D0%B0%D0%BB%D1%8C%D0%B1%D0%BE%D0%BC)\" title=\"Magical Mystery Tour (\u0430\u043b\u044c\u0431\u043e\u043c)\">Magical Mystery Tour<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1968_%D0%B3%D0%BE%D0%B4\" title=\"1968 \u0433\u043e\u0434\">1968<\/a>&#160;\u2014 \u043f\u0435\u0440\u0435\u0433\u043e\u0432\u043e\u0440\u044b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D1%80%D0%B0%D1%80%D0%B5\" title=\"\u0425\u0430\u0440\u0430\u0440\u0435\">\u0421\u043e\u043b\u0441\u0431\u0435\u0440\u0438<\/a> \u043c\u0435\u0436\u0434\u0443 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u044f\u043c\u0438 \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438 \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D0%B4%D0%B5%D0%B7%D0%B8%D1%8F\" title=\"\u0420\u043e\u0434\u0435\u0437\u0438\u044f\">\u0420\u043e\u0434\u0435\u0437\u0438\u0438<\/a> \u0437\u0430\u0448\u043b\u0438 \u0432 \u0442\u0443\u043f\u0438\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1969_%D0%B3%D0%BE%D0%B4\" title=\"1969 \u0433\u043e\u0434\">1969<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B5%D0%BB%D1%8C%D1%81%D0%B8%D0%BD%D0%BA%D0%B8\" title=\"\u0425\u0435\u043b\u044c\u0441\u0438