/ru.wikipedia.org\/wiki\/Aidstest\" title=\"Aidstest\">Aidstest<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%B7%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9,_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B9_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041b\u043e\u0437\u0438\u043d\u0441\u043a\u0438\u0439, \u0414\u043c\u0438\u0442\u0440\u0438\u0439 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u0414\u043c\u0438\u0442\u0440\u0438\u044f \u041b\u043e\u0437\u0438\u043d\u0441\u043a\u043e\u0433\u043e<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1989_%D0%B3%D0%BE%D0%B4\" title=\"1989 \u0433\u043e\u0434\">1989<\/a><ul><li>\u0412\u0442\u043e\u0440\u043e\u0439 \u043f\u043e\u043b\u0451\u0442 \u043f\u0435\u0440\u0432\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D1%82%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u0412\u0435\u0440\u0442\u043e\u043b\u0451\u0442\">\u0432\u0435\u0440\u0442\u043e\u043b\u0451\u0442\u0430<\/a>, \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u043e\u0433\u043e \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%BF%D0%BE%D0%B7%D0%B8%D1%86%D0%B8%D0%BE%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BC%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%B0%D0%BB\" title=\"\u041a\u043e\u043c\u043f\u043e\u0437\u0438\u0446\u0438\u043e\u043d\u043d\u044b\u0439 \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\">\u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0442\u043d\u044b\u0445 \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u043e\u0432<\/a> \u0438 \u043f\u0440\u0438\u0432\u043e\u0434\u0438\u043c\u043e\u0433\u043e \u0432 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0435 \u043c\u0443\u0441\u043a\u0443\u043b\u044c\u043d\u043e\u0439 \u0441\u0438\u043b\u043e\u0439 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430&#160;\u2014 \u00ab\u0414\u0430 \u0412\u0438\u043d\u0447\u0438 III\u00bb.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD-%D0%A1%D0%B0%D0%BB%D1%8C%D0%B2%D0%B0%D0%B4%D0%BE%D1%80\" title=\"\u0421\u0430\u043d-\u0421\u0430\u043b\u044c\u0432\u0430\u0434\u043e\u0440\">\u0421\u0430\u043d-\u0421\u0430\u043b\u044c\u0432\u0430\u0434\u043e\u0440\u0435<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BB%D1%8C%D0%B2%D0%B0%D0%B4%D0%BE%D1%80\" title=\"\u0421\u0430\u043b\u044c\u0432\u0430\u0434\u043e\u0440\">\u0421\u0430\u043b\u044c\u0432\u0430\u0434\u043e\u0440<\/a>, \u0432\u0441\u043f\u044b\u0445\u0438\u0432\u0430\u044e\u0442 \u0431\u043e\u0438 \u043f\u043e\u0441\u043b\u0435 \u0442\u043e\u0433\u043e, \u043a\u0430\u043a \u043e\u0442\u0440\u044f\u0434\u044b \u043f\u043e\u0432\u0441\u0442\u0430\u043d\u0446\u0435\u0432 \u0437\u0430\u0445\u0432\u0430\u0442\u044b\u0432\u0430\u044e\u0442 \u0447\u0430\u0441\u0442\u044c \u0433\u043e\u0440\u043e\u0434\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D0%B8%D1%86%D0%B8%D1%8F\" title=\"\u041f\u043e\u043b\u0438\u0446\u0438\u044f\">\u041f\u043e\u043b\u0438\u0446\u0438\u044f<\/a> \u0440\u0430\u0437\u0433\u043e\u043d\u044f\u0435\u0442 \u043c\u0438\u0440\u043d\u0443\u044e \u0434\u0435\u043c\u043e\u043d\u0441\u0442\u0440\u0430\u0446\u0438\u044e \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B0%D0%B3%D0%B0\" title=\"\u041f\u0440\u0430\u0433\u0430\">\u041f\u0440\u0430\u0433\u0435<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%85%D0%BE%D1%81%D0%BB%D0%BE%D0%B2%D0%B0%D0%BA%D0%B8%D1%8F\" title=\"\u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u043a\u0438\u044f\">\u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u043a\u0438\u044f<\/a>. \u041d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D1%80%D1%85%D0%B0%D1%82%D0%BD%D0%B0%D1%8F_%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D1%8F\" title=\"\u0411\u0430\u0440\u0445\u0430\u0442\u043d\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f\">\u0431\u0430\u0440\u0445\u0430\u0442\u043d\u043e\u0439 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u0438<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1990_%D0%B3%D0%BE%D0%B4\" title=\"1990 \u0433\u043e\u0434\">1990<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D0%B0%D1%80%D0%B8%D1%8F_%D0%A2%D1%83-154_%D0%BF%D0%BE%D0%B4_%D0%94%D1%83%D0%B1%D0%B5%D0%BD%D1%86%D0%BE%D0%BC\" title=\"\u0410\u0432\u0430\u0440\u0438\u044f \u0422\u0443-154 \u043f\u043e\u0434 \u0414\u0443\u0431\u0435\u043d\u0446\u043e\u043c\">\u0430\u0432\u0430\u0440\u0438\u044f \u0422\u0443-154 \u043f\u043e\u0434 \u0414\u0443\u0431\u0435\u043d\u0446\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1991_%D0%B3%D0%BE%D0%B4\" title=\"1991 \u0433\u043e\u0434\">1991<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D0%B3%D1%80%D0%B5%D1%81%D1%81_%D0%A1%D0%A8%D0%90\" title=\"\u041a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 \u0421\u0428\u0410\">\u041a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 \u0421\u0428\u0410<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u044b\u0432\u0430\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BE%D0%B0%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B7%D0%BE%D0%BD%D0%B0_%D1%81%D0%B2%D0%BE%D0%B1%D0%BE%D0%B4%D0%BD%D0%BE%D0%B9_%D1%82%D0%BE%D1%80%D0%B3%D0%BE%D0%B2%D0%BB%D0%B8\" title=\"\u0421\u0435\u0432\u0435\u0440\u043e\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0437\u043e\u043d\u0430 \u0441\u0432\u043e\u0431\u043e\u0434\u043d\u043e\u0439 \u0442\u043e\u0440\u0433\u043e\u0432\u043b\u0438\">NAFTA<\/a> (\u0421\u0435\u0432\u0435\u0440\u043e\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0435 \u0421\u0432\u043e\u0431\u043e\u0434\u043d\u043e\u0435 \u0422\u043e\u0440\u0433\u043e\u0432\u043e\u0435 \u0421\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435) \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u043e\u0439<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%BA%D1%81%D0%B8%D0%BA%D0%B0\" title=\"\u041c\u0435\u043a\u0441\u0438\u043a\u0430\">\u041c\u0435\u043a\u0441\u0438\u043a\u043e\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1993_%D0%B3%D0%BE%D0%B4\" title=\"1993 \u0433\u043e\u0434\">1993<\/a><ul><li>\u0412\u043e\u0435\u043d\u043d\u044b\u0439 \u043f\u0435\u0440\u0435\u0432\u043e\u0440\u043e\u0442 \u043f\u0440\u0435\u0440\u044b\u0432\u0430\u0435\u0442 \u043a\u043e\u0440\u043e\u0442\u043a\u0438\u0439 \u043f\u0435\u0440\u0438\u043e\u0434 \u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%B3%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u041d\u0438\u0433\u0435\u0440\u0438\u044f\">\u041d\u0438\u0433\u0435\u0440\u0438\u0438<\/a>. \u041c\u0438\u043d\u0438\u0441\u0442\u0440 \u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0433\u0435\u043d\u0435\u0440\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B1%D0%B0%D1%87%D0%B0,_%D0%A1%D0%B0%D0%BD%D0%B8\" title=\"\u0410\u0431\u0430\u0447\u0430, \u0421\u0430\u043d\u0438\">\u0421\u0430\u043d\u0438 \u0410\u0431\u0430\u0447\u0430<\/a> \u0431\u0435\u0440\u0451\u0442 \u043d\u0430 \u0441\u0435\u0431\u044f \u043f\u043e\u043b\u043d\u043e\u043c\u043e\u0447\u0438\u044f \u0433\u043b\u0430\u0432\u044b \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0430.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B1%D0%BE%D1%80%D0%BD%D0%B0%D1%8F_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8_%D0%BF%D0%BE_%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%83\" title=\"\u0421\u0431\u043e\u0440\u043d\u0430\u044f \u0420\u043e\u0441\u0441\u0438\u0438 \u043f\u043e \u0444\u0443\u0442\u0431\u043e\u043b\u0443\">\u0441\u0431\u043e\u0440\u043d\u043e\u0439 \u0420\u043e\u0441\u0441\u0438\u0438 \u043f\u043e \u0444\u0443\u0442\u0431\u043e\u043b\u0443<\/a> \u043f\u0440\u043e\u0438\u0441\u0445\u043e\u0434\u0438\u0442 \u0441\u043e\u0431\u044b\u0442\u0438\u0435, \u043d\u0430\u0437\u0432\u0430\u043d\u043d\u043e\u0435 \u0432 \u0434\u0430\u043b\u044c\u043d\u0435\u0439\u0448\u0435\u043c \u00ab\u0420\u0443\u0441\u0441\u043a\u0438\u0439 \u0431\u0443\u043d\u0442\u00bb \u0438\u043b\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D1%81%D1%8C%D0%BC%D0%BE_%D1%87%D0%B5%D1%82%D1%8B%D1%80%D0%BD%D0%B0%D0%B4%D1%86%D0%B0%D1%82%D0%B8\" title=\"\u041f\u0438\u0441\u044c\u043c\u043e \u0447\u0435\u0442\u044b\u0440\u043d\u0430\u0434\u0446\u0430\u0442\u0438\">\u041f\u0438\u0441\u044c\u043c\u043e \u0447\u0435\u0442\u044b\u0440\u043d\u0430\u0434\u0446\u0430\u0442\u0438<\/a>\u00bb, \u043a\u043e\u0433\u0434\u0430 \u043f\u043e\u0441\u043b\u0435 \u043c\u0430\u0442\u0447\u0430 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0413\u0440\u0435\u0446\u0438\u044f\">\u0413\u0440\u0435\u0446\u0438\u0435\u0439<\/a> \u0438\u0433\u0440\u043e\u043a\u0438 \u0441\u0431\u043e\u0440\u043d\u043e\u0439 \u043f\u043e\u0442\u0440\u0435\u0431\u043e\u0432\u0430\u043b\u0438 \u043e\u0442\u0441\u0442\u0430\u0432\u043a\u0438 \u0433\u043b\u0430\u0432\u043d\u043e\u0433\u043e \u0442\u0440\u0435\u043d\u0435\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%B4%D1%8B%D1%80%D0%B8%D0%BD,_%D0%9F%D0%B0%D0%B2%D0%B5%D0%BB_%D0%A4%D1%91%D0%B4%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0430\u0434\u044b\u0440\u0438\u043d, \u041f\u0430\u0432\u0435\u043b \u0424\u0451\u0434\u043e\u0440\u043e\u0432\u0438\u0447\">\u041f\u0430\u0432\u043b\u0430 \u0421\u0430\u0434\u044b\u0440\u0438\u043d\u0430<\/a>, \u0447\u0442\u043e \u043f\u0440\u0438\u0432\u0435\u043b\u043e \u043a \u0440\u0430\u0437\u0432\u0430\u043b\u0443 \u0441\u0431\u043e\u0440\u043d\u043e\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BB%D0%B0%D1%82%D0%B0_%D0%BF%D1%80%D0%B5%D0%B4%D1%81%D1%82%D0%B0%D0%B2%D0%B8%D1%82%D0%B5%D0%BB%D0%B5%D0%B9_%D0%A1%D0%A8%D0%90\" title=\"\u041f\u0430\u043b\u0430\u0442\u0430 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u0435\u0439 \u0421\u0428\u0410\">\u041f\u0430\u043b\u0430\u0442\u0430 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u0435\u0439 \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\u0430 \u0421\u0428\u0410<\/a> \u043e\u0434\u043e\u0431\u0440\u044f\u0435\u0442 \u0421\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u043e \u0441\u0432\u043e\u0431\u043e\u0434\u043d\u043e\u0439 \u0442\u043e\u0440\u0433\u043e\u0432\u043b\u0435, \u0437\u0430\u043a\u043b\u044e\u0447\u0451\u043d\u043d\u043e\u0435 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u043e\u0439<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%BA%D1%81%D0%B8%D0%BA%D0%B0\" title=\"\u041c\u0435\u043a\u0441\u0438\u043a\u0430\">\u041c\u0435\u043a\u0441\u0438\u043a\u043e\u0439<\/a>.<\/li><li>\u0421\u0443\u0434\u044c\u0438 \u0438\u0437 11 \u0441\u0442\u0440\u0430\u043d \u0441\u043e\u0431\u0440\u0430\u043b\u0438\u0441\u044c \u043d\u0430 \u043f\u0435\u0440\u0432\u043e\u0435 \u0437\u0430\u0441\u0435\u0434\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B6%D0%B4%D1%83%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D0%B9_%D1%82%D1%80%D0%B8%D0%B1%D1%83%D0%BD%D0%B0%D0%BB_%D0%BF%D0%BE_%D0%B1%D1%8B%D0%B2%D1%88%D0%B5%D0%B9_%D0%AE%D0%B3%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%B8%D0%B8\" title=\"\u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u0442\u0440\u0438\u0431\u0443\u043d\u0430\u043b \u04